import React, { useEffect } from "react";
import Navbar from "../../components/Navbar";
// formik
import { Formik, Field, Form } from "formik";

function Login() {
  useEffect(() => {
    document.title = "Admin | Login";
  });

  return (
    <div className="min-h-screen max-w-2xl mx-auto font-inter">
      <Navbar />
      <div className="w-full max-w-md bg-white dark:bg-gray-800 shadow-lg rounded-lg px-6 py-12 mt-16">
        <h2 className="text-2xl font-bold text-center mb-6">Admin Girişi</h2>
        <Formik
          initialValues={{ name: "", email: "" }}
          onSubmit={async (values) => {
            await new Promise((resolve) => setTimeout(resolve, 500));
            alert(JSON.stringify(values, null, 2));
          }}
        >
          <Form className="space-y-4">
            <div>
              <label htmlFor="name" className="block text-sm font-medium">Adınız</label>
              <Field name="name" type="text" className="w-full mt-1 p-2 border rounded-md bg-gray-50 dark:bg-gray-700 focus:ring-2 focus:ring-blue-500" />
            </div>
            <div>
              <label htmlFor="email" className="block text-sm font-medium">Email</label>
              <Field name="email" type="email" className="w-full mt-1 p-2 border rounded-md bg-gray-50 dark:bg-gray-700 focus:ring-2 focus:ring-blue-500" />
            </div>
            <button type="submit" className="w-full bg-blue-600 hover:bg-blue-700 text-white py-2 px-4 rounded-md transition">Giriş Yap</button>
          </Form>
        </Formik>
      </div>
    </div>
  );
}

export default Login;
